        public static IEnumerable<string> GetBuiltInFieldId(string value)
        {
            List<string> result = new List<string>();

            IEnumerable<Guid> guids = SPFields.Keys.Where(key => SPFields.GetValues(key).Contains(value)).ToArray();

            if (guids.Any())
                result = guids.SelectMany(g => SPFields.GetValues(g)).ToList();

            return result;
        }

        public static string GetBuiltInFieldId(Guid value)
        {
            string result = String.Empty;

            var guid = SPFields.Keys.Where(key => key == value).FirstOrDefault();

            if (guid != Guid.Empty)
                result = SPFields.GetValues(guid).FirstOrDefault();

            return result;
        }
    }
